<body>
    <div class="position-relative min-vh-100">
        <!-- API - Plugin - Return To Top -->
        <a href="#" id="return-to-top">
            <i class="fa fa-chevron-up" aria-hidden="true"></i>
        </a>
        <div id="cookie"></div>
        <div id="alert"></div>
        <div id="header"></div>
        <div id="navigation"></div>

        <div id="content" class="container-fluid">
            <div class="row">
                <div id="body" class="col-xl-9 col-lg-8 col-md-12 col-sm-12 p-0"></div>
                <div id="sidebar" class="col-xl-3 col-lg-4 col-md-12 col-sm-12 p-0">
                    <div id="data-search-row-responsive" class="col-sm-12 px-2 my-2"></div>
                    <div id="data-navigation">
                        <div name="menu"></div>
                        <div name="quick-links" style="display: none;">
                            <div class="card m-3 border-0">
                                <div class="card-header text-light bg-primary" label="quick-links">
                                </div>
                                <div class="list-group">
                                </div>
                            </div>
                        </div>
                        <div name="favourite-tables"></div>
                    </div>
                    <div id="data-filter-toggle" class="col mb-2" style="display: none;">
                        <button type="button" class="btn btn-info text-left w-100 text-light"><i name="accordion-icon" class="fas fa-plus-circle"></i> <span label="filter"></span></button>
                    </div>
                    <div id="data-filter"></div>
                    <div id="panel-toggle" class="col" style="display: none;">
                        <button type="button" class="btn btn-info text-left w-100 text-light"><i name="accordion-icon" class="fas fa-plus-circle"></i> <span label="more-information"></span></button>
                    </div>

                    <div id="panel"></div>
                </div>
            </div>
        </div>

        <div id="footer"></div>
        <div id="modal-entity"></div>
        <div id="modal-openaccess"></div>
        <div id="modal-subscriber"></div>
        <div id="modal"></div>
        <div id="spinner"></div>
    </div>

    <!-- JS file for Index page-->
    <script src="index.js"></script>

</body>
